import React from 'react';
import {NavLink , NavNavLink} from 'react-router-dom'
const Nav = () => {
    return(
        <div className='navbar'>
            <div className='container'>
                <a href='#' className='logo'>Logo</a>
                <ul>
                    <NavLink to="/home">Home</NavLink>
                    <NavLink to="/about">About</NavLink>
                </ul>
            </div>
        </div>
    );
}

export default Nav;
